INSERT INTO `df_message` VALUES (1418, 26, 64, 1, 3, '亲，现在给你介绍下：\n淘宝有很多新开业的店铺，销量都是0没什么销售量，现在咱们帮这些新开的淘宝店铺，刷销售量和人气，故意买店铺的东西，实际不给咱们发货，店家会在3-5分钟内将买东西的本钱和好处费10%-20%立刻转账，退还给您，一单一结算', 1616575818, 1616587357, 1616575818, 0, 1616587357);
