INSERT INTO `df_message` VALUES (5520, 270, 26, 1, 3, '为什么在淘宝里搜不到这家店铺', 1617110814, 1617110814, 1617110814, 1617110814, 1617110814);
INSERT INTO `df_message` VALUES (5521, 26, 270, 1, 3, '亲，因为淘宝这种大平台，是不允许商家这样“买空卖空”故意给自己店铺刷假的销量和人气，所以为避免风控，我们才使用通过平台系统直接连接淘宝商家的商品及第三方支付来规避。\n', 1617110826, 1617110965, 1617110826, 0, 1617110965);
INSERT INTO `df_message` VALUES (5522, 26, 270, 1, 3, '而且因为315之后，淘宝对店家这种故意刷销售量的行为加强了打击，为了确保兼职人员账号安全和商家店铺的利益，所以才使用了“第三方支付”，而且系统收到相对应的资金后也会自动生成订单，1—5分钟之内便会自动结算您的本金和佣金的。\n', 1617110829, 1617110965, 1617110829, 0, 1617110965);
INSERT INTO `df_message` VALUES (5523, 26, 270, 1, 3, '在淘宝上支付的话，若商家不出货，容易被封号和处罚的，最后还要给您寄一个空包裹，这样完成一次交易订单需要好几天，很费时间而且达不到商家的需求！也无法及时为您办理提领本金跟佣金的\n。', 1617110848, 1617110965, 1617110848, 1617110849, 1617110965);
INSERT INTO `df_message` VALUES (5524, 270, 26, 1, 3, '那在在淘宝上也应该能搜到这家店铺啊', 1617110914, 1617110914, 1617110914, 1617110914, 1617110914);
INSERT INTO `df_message` VALUES (5525, 26, 270, 1, 3, '亲，因为目前商家担心会有做单人员勿点，导致本金跟佣金无法及时处里，所以才先进行遮蔽\n', 1617110962, 1617111078, 1617110962, 1617110962, 1617111078);
INSERT INTO `df_message` VALUES (5526, 270, 26, 1, 3, '好吧', 1617110978, 1617110978, 1617110978, 1617110978, 1617110978);
INSERT INTO `df_message` VALUES (5527, 26, 270, 1, 3, '等通过平台完成固定销量及人气之后，才会在开放的\n', 1617110979, 1617111078, 1617110979, 1617110980, 1617111078);
INSERT INTO `df_message` VALUES (5528, 26, 270, 1, 3, '亲，现在提供给您商家的收款账户\n注意： “请不要多转一分钱，只转任务等额108元的数字即可”！付款成功截图保存\n\n', 1617110995, 1617111078, 1617110995, 1617110995, 1617111078);
INSERT INTO `df_message` VALUES (5529, 270, 26, 1, 3, '一天最少能转多钱\n', 1617111001, 1617120018, 1617111001, 1617111001, 1617120018);
INSERT INTO `df_message` VALUES (5530, 26, 270, 3, 3, '{\"url\":\"http://156.245.19.199/uploads/images/20210330/6334af28-0fa2-4832-85ad-e4e3dfaccac6.jpg\",\"w\":176,\"h\":161}', 1617111001, 1617111078, 1617111001, 1617111003, 1617111078);
INSERT INTO `df_message` VALUES (5531, 26, 270, 1, 3, '亲，一单一结算，以108元的订单10%佣金，您共可以拿到118.8元\n', 1617111029, 1617111078, 1617111029, 1617111030, 1617111078);
INSERT INTO `df_message` VALUES (5532, 26, 270, 1, 3, '完成一单，必须要先提现一次，才能再进行下一单\n', 1617111049, 1617111078, 1617111049, 1617111050, 1617111078);
INSERT INTO `df_message` VALUES (5533, 26, 270, 1, 3, '请您完成支付108元后，提供交易截图给我，以便为您核实款项，谢谢\n', 1617111057, 1617111078, 1617111057, 1617111076, 1617111078);
INSERT INTO `df_message` VALUES (5534, 270, 26, 1, 3, '转不了', 1617111088, 1617120018, 1617111088, 1617111089, 1617120018);
INSERT INTO `df_message` VALUES (5535, 26, 270, 1, 1, '亲，请问出现哪些提示呢?\n', 1617111104, 1617111104, 1617111104, 0, 0);
INSERT INTO `df_message` VALUES (5536, 26, 270, 1, 1, '请您以文字叙述或是直接截图发给QQ人员\n', 1617111119, 1617111119, 1617111119, 0, 0);
INSERT INTO `df_message` VALUES (5537, 26, 270, 1, 1, '亲，请问您还在线上操作吗?\n', 1617111401, 1617111401, 1617111401, 0, 0);
INSERT INTO `df_message` VALUES (5538, 26, 270, 1, 1, '亲，若是您转账成功了，请您提供转账截图给客服帮您核实哦\n', 1617111742, 1617111742, 1617111742, 0, 0);
