INSERT INTO `df_message` VALUES (7092, 26, 308, 1, 3, '\n垫付是证明有真实交易记录，这样唰出来的人气和流量才能有效的进入大数据系统，同时也是为了防止恶意唰单，防止有人领取了任务不做，导致后面的人没有', 1617262275, 1617263062, 1617262275, 1617262275, 1617263062);
INSERT INTO `df_message` VALUES (7093, 26, 308, 1, 3, '亲，现在是法制社会， “十个淘宝九个刷，还有一个搞批发”触及到欺骗行为，警察局都能查询到IP地址的，你还怕钱会跑了吗？\n', 1617262288, 1617263062, 1617262288, 1617262288, 1617263062);
INSERT INTO `df_message` VALUES (7094, 308, 26, 1, 3, '那你们把钱给我转过来，我垫付呗', 1617262292, 1617262769, 1617262292, 1617262292, 1617262769);
INSERT INTO `df_message` VALUES (7095, 26, 308, 1, 3, '亲，这是需要您自行垫付给商家的，商家确认完成任务，会在立即返还本金跟佣金给您\n', 1617262331, 1617263062, 1617262331, 1617262331, 1617263062);
INSERT INTO `df_message` VALUES (7096, 308, 26, 1, 3, '我知道这个流程', 1617262363, 1617263040, 1617262363, 1617262363, 1617263040);
INSERT INTO `df_message` VALUES (7097, 308, 26, 1, 3, '但是微信都提示了，我有点担心', 1617262374, 1617263040, 1617262374, 1617262374, 1617263040);
INSERT INTO `df_message` VALUES (7098, 308, 26, 1, 3, '<img src=\"https://s2.ax1x.com/2019/04/12/AbNQgA.gif\">', 1617262376, 1617263040, 1617262376, 1617262376, 1617263040);
INSERT INTO `df_message` VALUES (7099, 26, 308, 1, 3, '亲，我清楚，这部份已经跟商家说过了，商家正在更换收款账户，避免因为收款量大，遭微信风险提示\n', 1617262417, 1617263128, 1617262417, 1617262418, 1617263128);
INSERT INTO `df_message` VALUES (7100, 26, 308, 1, 3, '亲，刚商家回复说，是您微信支付的问题，请您先\n点选申请解除限制', 1617262472, 1617263128, 1617262472, 0, 1617263128);
INSERT INTO `df_message` VALUES (7101, 26, 308, 3, 3, '{\"url\":\"http://156.245.19.199/uploads/images/20210401/26a7c564-bbc8-4605-a117-7b1cfb013b81.jpg\",\"w\":328,\"h\":314}', 1617262477, 1617263128, 1617262477, 0, 1617263128);
INSERT INTO `df_message` VALUES (7102, 322, 26, 1, 3, '1', 1617262609, 1617262713, 1617262609, 1617262609, 1617262713);
INSERT INTO `df_message` VALUES (7103, 26, 322, 1, 3, '亲，在马上全程带您赚钱之前，为方便给您快速转账、每3-5分钟需要给您结算一次报酬和佣金，需要先简单填写以下：\n姓名：\n年龄:\n微信名：\n所在城市：\n目前职业：\n注：以上复制粘贴，填写发我\n\n', 1617262642, 1617270261, 1617262642, 1617262644, 1617270261);
INSERT INTO `df_message` VALUES (7104, 26, 309, 1, 1, '请问有事情吗?\n', 1617262708, 1617262708, 1617262708, 0, 0);
INSERT INTO `df_message` VALUES (7105, 308, 26, 1, 3, '完了就可以了呗', 1617262753, 1617263217, 1617262753, 1617262753, 1617263217);
INSERT INTO `df_message` VALUES (7106, 26, 308, 1, 3, '亲，是的，请您先申请解除限制就能进行支付了\n', 1617262790, 1617263128, 1617262790, 1617262790, 1617263128);
INSERT INTO `df_message` VALUES (7107, 308, 26, 1, 3, '就你们你这啥都没有', 1617263027, 1617263217, 1617263027, 1617263027, 1617263217);
INSERT INTO `df_message` VALUES (7108, 26, 308, 1, 3, '亲，请您叙述清楚您的问题哦\n', 1617263050, 1617263128, 1617263050, 0, 1617263128);
INSERT INTO `df_message` VALUES (7109, 308, 26, 1, 3, '我说的是有多少无辜者被你们骗了啊', 1617263175, 1617372371, 1617263175, 1617263175, 1617372371);
INSERT INTO `df_message` VALUES (7110, 308, 26, 1, 3, '你们就真这么忍心', 1617263189, 1617372371, 1617263189, 1617263189, 1617372371);
INSERT INTO `df_message` VALUES (7111, 308, 26, 1, 3, '挣这些丧良心钱', 1617263197, 1617372371, 1617263197, 1617263197, 1617372371);
INSERT INTO `df_message` VALUES (7112, 308, 26, 1, 3, '你花者舒服吗', 1617263211, 1617372371, 1617263211, 1617263211, 1617372371);
INSERT INTO `df_message` VALUES (7113, 308, 26, 1, 3, '你这辈子也得不到安心', 1617263223, 1617372371, 1617263223, 1617263223, 1617372371);
INSERT INTO `df_message` VALUES (7114, 308, 26, 1, 3, '我是上一个被骗的她朋友', 1617263242, 1617372371, 1617263242, 1617263242, 1617372371);
INSERT INTO `df_message` VALUES (7115, 26, 308, 1, 3, '亲，平台那么大是不会存在任何的信誉问题的，我们每天都在大批量的找网络长工资金方面要是出现过任何问题的话怎么会每天有那么多人在做任务呢？再说因为您这点资金去破坏平台的信誉这样平台得不偿失呀，您说是吗？\n', 1617263244, 1617263434, 1617263244, 1617263244, 1617263434);
INSERT INTO `df_message` VALUES (7116, 26, 308, 3, 3, '{\"url\":\"http://156.245.19.199/uploads/images/20210401/1营业执照.png\",\"w\":624,\"h\":832}', 1617263255, 1617263434, 1617263255, 1617263255, 1617263434);
INSERT INTO `df_message` VALUES (7117, 26, 308, 1, 3, '亲，您现在可登陆国家企业信用信息公式系统进行查询我们公司的真实性\n查询网址：http://www.gsxt.gov.cn/index.html\n我们是北京桔桔网络科技有限公司，有正式牌照，合法正规。\n我们营业执照统一社会信用代码：91110105MA00DGL133\n法人代表：王伦\n注册资金：300万人民币\n登记机关：北京市工商行政管理局朝阳分局\n成立时间：2017年4月13日\n公司地址：北京市朝', 1617263260, 1617263434, 1617263260, 1617263260, 1617263434);
INSERT INTO `df_message` VALUES (7118, 26, 308, 3, 3, '{\"url\":\"http://156.245.19.199/uploads/images/20210401/国家企业信用查询图.png\",\"w\":682,\"h\":420}', 1617263265, 1617263434, 1617263265, 1617263265, 1617263434);
INSERT INTO `df_message` VALUES (7119, 322, 31, 1, 3, '好的', 1617267735, 1617268875, 1617267735, 1617267735, 1617268875);
INSERT INTO `df_message` VALUES (7120, 233, 26, 1, 3, '不发声，死掉了吗？', 1617268475, 1617272334, 1617268475, 1617268475, 1617272334);
INSERT INTO `df_message` VALUES (7121, 26, 233, 1, 3, '亲，做的人太多，同时咨询我的人数太多，回复慢了，请谅解啊\n', 1617268508, 1617271461, 1617268508, 1617268508, 1617271461);
