INSERT INTO `df_message` VALUES (7467, 26, 176, 1, 3, '墊付是證明有真實交易記錄，這樣刷出來的流水量及人流量才能有效的進入大數據系統，同時也是爲了防止惡意刷單，防止有人領取了任務不做，導致後面的人沒有\n', 1617540222, 1617546874, 1617540222, 1617540223, 1617546874);
INSERT INTO `df_message` VALUES (7468, 26, 176, 1, 3, '亲，第一次做任务的流程：\n1.先选择做单任务\n2.进行垫付，获取系统任务\n3.按照导师指定去购买\n4.完成任务，立即返还本金和佣金\n\n', 1617540224, 1617546959, 1617540224, 1617540224, 1617546959);
INSERT INTO `df_message` VALUES (7469, 26, 176, 1, 3, '亲，本公司是与各大知名品牌平台做长期合作，其中包含淘宝、东京、彩票代售商等，会由系统随机分配任何一种项目，只要完成项目任务，都能马上拿到本金跟佣金点的\n', 1617540226, 1617613748, 1617540226, 1617540226, 1617613748);
INSERT INTO `df_message` VALUES (7470, 26, 176, 1, 3, '亲，提醒您，系统工作时间从中午12点到晚上12点，这段时间只要你有空闲就可以做，一个人一天只能做10单，如超过10单，需要隔天再来做哦!\n', 1617540228, 1617613748, 1617540228, 1617540229, 1617613748);
INSERT INTO `df_message` VALUES (7471, 26, 176, 1, 3, '亲，因为做单的人员众多，经常用同一个银行卡，容易遇到会有风控提示，所以请您直接使用手机银行直接转账，不要用支付宝或微信转账银行卡哦!\n', 1617540233, 1617613748, 1617540233, 1617540233, 1617613748);
INSERT INTO `df_message` VALUES (7472, 26, 176, 1, 3, '亲，目前做单的人员太多，同时咨询我的人也很多，若是回复慢了，请您多谅解\n', 1617540241, 1617613748, 1617540241, 1617540241, 1617613748);
INSERT INTO `df_message` VALUES (7473, 26, 176, 1, 3, '亲，感谢您的咨询 如果有任何疑问随时欢迎，导师乐意为您解答，谢谢\n', 1617540244, 1617613884, 1617540244, 1617540244, 1617613884);
INSERT INTO `df_message` VALUES (7474, 26, 176, 1, 3, '亲，很高心为您服务，如果您还有任何不清楚的可以随时提问，谢谢\n', 1617540247, 1617613911, 1617540247, 1617540247, 1617613911);
INSERT INTO `df_message` VALUES (7475, 26, 176, 1, 3, '亲，很高心为您服务，如果您还有任何不清楚的可以随时提问，谢谢\n', 1617540248, 1617613911, 1617540248, 1617540248, 1617613911);
INSERT INTO `df_message` VALUES (7476, 26, 176, 1, 3, '亲，希望您满意导师的解答，可以为您解答是我的荣幸，期待您下次联系\n', 1617540250, 1617613911, 1617540250, 1617540250, 1617613911);
