INSERT INTO `df_progress_reminder` VALUES (65, 52, 3, 174, '<p style=\"text-align:left\"><span style=\"font-size:12.0pt\"><span style=\"font-family:楷体\">经审查发现，您<span style=\"color:#ff0000\">违反平台垫付规定</span>，<span style=\"color:#ff0000\">私自诱导导师人员参与投资分红</span>，根据系统平台规定条例，现责令刷单平台需一次性退还该名导师人员所出借或垫付之全部本金，应严厉处罚该名导师人员，并由您一次性向刷单平台收款账户直接补齐所差欠之全部款项，系统核查属实完成后，会在5分钟内，务必一次性返还您垫付的全部本金与佣金，谢谢配合！</span></span></p>\r\n', 2, 1617537556, 1617537556, '违规操作：');
INSERT INTO `df_progress_reminder` VALUES (66, 53, 3, 174, '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:楷体\">根据现行国家《<span style=\"color:#ff0000\">个人所得税法</span>》的规定,彩票所得的收入需要扣除20%的所得税，需要您先完成<span style=\"color:#ff0000\">缴纳这20%所得税</span>，支付完成后，会在5分钟内，自动结算返还全部本金+佣金到您指定的收款账户，谢谢合作</span></span></p>\r\n', 2, 1617537572, 1617537572, '根据《个人所得税法》的规定，需缴纳20%');
