INSERT INTO `df_system_config` VALUES (1, ' <view>\r\n            \r\n          1.特别提示<br>\r\n          \r\n          1.1为了更好地为您提供服务，请您仔细阅读这份协议。本协议是您与本应用就您登录本应用平台进行注册及使用等所涉及的全部行为所订立的权利义务规范。您在注册过程中点击“注册”等按钮、及注册后登录和使用时，均表明您已完全同意并接受本协议，愿意遵守本协议的各项规则、规范的全部内容，若不同意则可停止注册或使用本应用平台。如您是未成年人，您还应要求您的监护人仔细阅读本协议，并取得他/他们的同意。\r\n          <br>\r\n          1.2为提高用户的使用感受和满意度，用户同意本应用将基于用户的操作行为对用户数据进行调查研究和分析，从而进一步优化服务。\r\n            \r\n            \r\n        </view>\r\n        <view>\r\n         2.服务内容\r\n         <br>\r\n         2.1本APP是一个真人社交应用平台，平台内严禁一切非法、涉黄信息，违反社区运营规范者，一律封号处理。\r\n         <br>\r\n         2.2本应用服务的具体内容由本应用制作者根据实际情况提供。\r\n         <br>\r\n          2.3 除非本注册及服务协议另有其它明示规定，本应用所推出的新产品、新功能、新服务，均受到本注册及注册协议规范。n2.4 本应用仅提供相关的网络服务，除此之外与相关网络服务有关的设备(如个人电脑、手机、及其他与接入互联网或移动网有关的装置)及所需的费用(如为接入互联网而支付的电话费及上网费、为使用移动网而支付的手机费)均应由用户自行负担。\r\n            \r\n            \r\n            \r\n        </view>\r\n        <view>\r\n            3.使用规则\r\n            <br>\r\n            3.1 用户帐号注册\r\n            <br>\r\n            3.1.1使用本应用系统注册的用户，只能使用汉字、英文字母、数字、下划线及它们的组合，禁止使用空格、各种符号和特殊字符，且最多不超过16个字符(8个汉字)注册，否则将不予注册。\r\n            <br>\r\n            3.1.2使用第三方合作网站登录的用户，只能使用汉字、英文字母、数字、下划线及它们的组合，禁止使用空格、各种符号和特殊字符，且最多不超过14个字符(7个汉字)注册，否则本社区有权只截取前14个字符（7个汉字）予以显示用户帐号（若该用户帐号与应用现有用户帐号重名，系统将随机添加一个字符以示区别），否则将不予注册。\r\n            <br>\r\n            3.2如发现用户帐号中含有不雅文字或不恰当名称的，心动保留取消其用户资格的权利。\r\n            <br>\r\n            3.2.1请勿以党和国家领导人或其他社会名人的真实姓名、字号、艺名、笔名注册；\r\n            <br>\r\n            3.2.2请勿以国家机构或其他机构的名称注册；\r\n            <br>\r\n            3.2.3请勿注册不文明、不健康名字，或包含歧视、侮辱、猥亵类词语的帐号；\r\n            <br>\r\n            3.2.4请勿注册易产生歧义、引起他人误解或其它不符合法律规定的帐号。\r\n            <br>\r\n            3.3用户帐号的所有权归本应用，用户仅享有使用权。\r\n            <br>\r\n            3.4用户有义务保证密码和帐号的安全，用户利用该密码和帐号所进行的一切活动引起的任何损失或损害，由用户自行承担全部责任，本应用不承担任何责任。如用户发现帐号遭到未授权的使用或发生其他任何安全问题，应立即修改帐号密码并妥善保管，如有必要，请反馈通知本应用管理人员。因黑客行为或用户的保管疏忽导致帐号非法使用，本应用不承担任何责任。\r\n            <br>\r\n            3.5 用户承诺对其发表或者上传于本应用的所有信息(即属于《中华人民共和国著作权法》规定的作品，包括但不限于文字、图片、音乐、电影、表演和录音录像制品和电脑程序等)均享有完整的知识产权，或者已经得到相关权利人的合法授权；如用户违反本条规定造成本应用被第三人索赔的，用户应全额补偿本应用的一切费用(包括但不限于各种赔偿费、诉讼代理费及为此支出的其它合理费用)；\r\n            <br>\r\n            3.6当第三方认为用户发表或者上传于本应用的信息侵犯其权利，并根据《信息网络传播权保护条例》或者相关法律规定向本应用发送权利通知书时，用户同意本应用可以自行判断决定删除涉嫌侵权信息，除非用户提交书面证据材料排除侵权的可能性，本应用将不会自动恢复上述删除的信息；\r\n            <br>\r\n            (1)不得为任何非法目的而使用网络服务系统；\r\n            <br>\r\n            (2)遵守所有与网络服务有关的网络协议、规定和程序；\r\n            <br>\r\n            (3)不得利用本应用的服务进行任何可能对互联网的正常运转造成不利影响的行为；\r\n            <br>\r\n            (4)不得利用本应用服务进行任何不利于本应用的行为。\r\n            <br>\r\n            3.7如用户在使用网络服务时违反上述任何规定，本应用有权要求用户改正或直接采取一切必要的措施(包括但不限于删除用户上传的内容、暂停或终止用户使用网络服务的权利)以减轻用户不当行为而造成的影响。\r\n            \r\n            \r\n            \r\n            \r\n        </view>\r\n        <view>\r\n            4.责任声明\r\n            <br>\r\n            4.1 任何网站、单位或者个人如认为本应用或者本应用提供的相关内容涉嫌侵犯其合法权益，应及时向本应用提供书面权力通知，并提供身份证明、权属证明及详细侵权情况证明。本应用在收到上述法律文件后，将会尽快切断相关内容以保证相关网站、单位或者个人的合法权益得到保障。\r\n            <br>\r\n            4.2用户明确同意其使用本应用网络服务所存在的风险及一切后果将完全由用户本人承担，本应用对此不承担任何责任。\r\n           <br> \r\n            4.3本应用无法保证网络服务一定能满足用户的要求，也不保证网络服务的及时性、安全性、准确性。\r\n            <br>\r\n            4.4本应用不保证为方便用户而设置的外部链接的准确性和完整性，同时，对于该等外部链接指向的不由本应用实际控制的任何网页上的内容，本应用不承担任何责任。\r\n            \r\n            \r\n            \r\n        </view>\r\n        <view>\r\n            \r\n            5.知识产权\r\n            <br>\r\n            5.1 本应用特有的标识、版面设计、编排方式等版权均属本应用享有，未经本应用许可授权，不得任意复制或转载。\r\n            <br>\r\n            5.2 用户从本应用的服务中获得的信息，未经本应用的许可，不得任意复制或转载。\r\n            <br>\r\n            5.3 本应用的所有内容，包括商品描述、图片等内容所有权归属于本APP的用户，任何人不得转载。\r\n            <br>\r\n            5.4 本应用所有用户上传内容仅代表用户自己的立场和观点，与本应用无关，由作者本人承担一切法律责任。\r\n            <br>\r\n            5.5上述及其他任何本服务包含的内容的知识产权均受到法律保护，未经本应用、用户或相关权利人书面许可，任何人不得以任何形式进行使用或创造相关衍生作品。\r\n            \r\n            \r\n        </view>\r\n        <view>\r\n            \r\n         6.隐私保护\r\n         <br>\r\n         6.1 本应用不对外公开或向第三方提供单个用户的注册资料及用户在使用网络服务时存储在本社区的非公开内容，但下列情况除外：\r\n         <br>\r\n         (1)事先获得用户的明确授权；\r\n         <br>\r\n         (2)根据有关的法律法规要求；\r\n         <br>\r\n         (3)按照相关政府主管部门的要求；\r\n         <br>\r\n         (4)为维护社会公众的利益。\r\n         <br>\r\n         6.2 本应用可能会与第三方合作向用户提供相关的网络服务，在此情况下，如该第三方同意承担与本社区同等的保护用户隐私的责任，则本社区有权将用户的注册资料等信息提供给该第三方，并无须另行告知用户。\r\n         <br>\r\n         6.3 在不透露单个用户隐私资料的前提下，本应用有权对整个用户数据库进行分析并对用户数据库进行商业上的利用。\r\n            \r\n            \r\n        </view>\r\n        <view>\r\n            \r\n            7.协议修改\r\n            <br>\r\n            7.1本应用有权随时修改本协议的任何条款，一旦本协议的内容发生变动，本应用将会在本应用上公布修改之后的协议内容，若用户不同意上述修改，则可以选择停止使用本应用。本应用也可选择通过其他适当方式（比如系统通知）向用户通知修改内容。\r\n            <br>\r\n            7.2如果不同意本应用对本协议相关条款所做的修改，用户有权停止使用本应用。如果用户继续使用本应用，则视为用户接受本应用对本协议相关条款所做的修改。\r\n            \r\n            \r\n            \r\n        </view>\r\n\r\n       <view>\r\n            8.联系我们<br>\r\n            \r\n            如果您有投诉、建议、疑问，请联系我们官方小助手。\r\n             \r\n        </view>', '    \r\n		本应用尊重并保护所有使用服务用户的个人隐私权。为了给您提供更准确、更有个性化的服务，本应用会按照本隐私权政策的规定使用和披露您的个人信息。\r\n        但本应用将以高度的勤勉、审慎义务对待这些信息。<br>\r\n        除本隐私权政策另有规定外，在未征得您事先许可的情况下，本应用不会将这些信息对外披露或向第三方提供。本应用会不时更新本隐私权政策。 您在同意本应用服务使用协议之时，即视为您已经同意本隐私权政策全部内容。本隐私权政策属于本应用服务使用协议不可分割的一部分。\r\n		<br>\r\n       \r\n       <view>\r\n         1.适用范围<br>\r\n         (a)在您使用本应用时，我们可能会申请系统设备权限收集设备信息、日志信息，用于推送和安全风控，并申请存储权限，用于下载及缓存相关文件；<br>\r\n         (b)您使用发布视频、语音、图片等功能时候，我们会请求您授权相机、照片、麦克风的权限。您如果拒绝授权提供，将无法使用此功能，但不影响您使用本应用的其他功能。 <br>  \r\n         (c) 在您使用本应用网络服务，本应用自动接收并记录您的设备信息，包括但不限于您的IP地址、使用的语言、访问日期和时间、软硬件特征信息等数据；\r\n         <br>  \r\n         (d) 本应用通过合法途径从商业伙伴处取得的用户个人数据。<br>  \r\n         \r\n       </view>\r\n       \r\n       <view>\r\n2.您了解并同意，以下信息不适用本隐私权政策：<br>\r\n		\r\n		(a) 您在使用本应用平台提供的搜索服务时输入的关键字信息；<br>\r\n		\r\n		(b) 本应用收集到的您在本应用发布的有关信息数据，包括但不限于参与活动、成交信息及评价详情；<br>\r\n		\r\n		(c) 违反法律规定或违反本应用规则行为及本应用已对您采取的措施。<br>           \r\n           \r\n       </view>\r\n       \r\n       <view>\r\n           \r\n          \r\n          3.信息使用\r\n          (a)本应用不会向任何无关第三方提供、出售、出租、分享或交易您的个人信息，除非事先得到您的许可，或该第三方和本应用（含本应用关联公司）单独或共同为您提供服务，且在该服务结束后，其将被禁止访问包括其以前能够访问的所有这些资料。<br>\r\n          \r\n          (b) 本应用亦不允许任何第三方以任何手段收集、编辑、出售或者无偿传播您的个人信息。任何本应用平台用户如从事上述活动，一经发现，本应用有权立即终止与该用户的服务协议。<br>\r\n          \r\n          (c) 为服务用户的目的，本应用可能通过使用您的个人信息，向您提供您感兴趣的信息，包括但不限于向您发出产品和服务信息，或者与本应用合作伙伴共享信息以便他们向您发送有关其产品和服务的信息（后者需要您的事先同意）。<br>\r\n           \r\n       </view>\r\n       \r\n       <view>\r\n           4.信息披露<br>\r\n           在如下情况下，本应用将依据您的个人意愿或法律的规定全部或部分的披露您的个人信息：<br>\r\n           \r\n           (a) 经您事先同意，向第三方披露；<br>\r\n           \r\n           (b)为提供您所要求的产品和服务，而必须和第三方分享您的个人信息；<br>\r\n           \r\n           (c) 根据法律的有关规定，或者行政或司法机构的要求，向第三方或者行政、司法机构披露；<br>\r\n           \r\n           (d) 如您出现违反中国有关法律、法规或者本应用服务协议或相关规则的情况，需要向第三方披露；<br>\r\n           \r\n           (e) 如您是适格的知识产权投诉人并已提起投诉，应被投诉人要求，向被投诉人披露，以便双方处理可能的权利纠纷；<br>\r\n           \r\n           (f) 在本应用平台上创建的某一交易中，如交易任何一方履行或部分履行了交易义务并提出信息披露请求的，本应用有权决定向该用户提供其交易对方的联络方式等必要信息，以促成交易的完成或纠纷的解决。<br>\r\n           \r\n           (g) 其它本应用根据法律、法规或者网站政策认为合适的披露。<br>\r\n           \r\n           \r\n       </view>\r\n       \r\n       <view>\r\n           \r\n          5.信息存储和交换<br>\r\n          本应用收集的有关您的信息和资料将保存在本应用及（或）其关联公司的服务器上，这些信息和资料可能传送至您所在国家、地区或本应用收集信息和资料所在地的境外并在境外被访问、存储和展示。\r\n          <br>\r\n          6.Cookie的使用<br>\r\n          (a) 在您未拒绝接受cookies的情况下，本应用会在您的计算机上设定或取用cookies ，以便您能登录或使用依赖于cookies的本应用平台服务或功能。本应用使用cookies可为您提供更加周到的个性化服务，包括推广服务。\r\n          <br>\r\n          (b) 您有权选择接受或拒绝接受cookies。您可以通过修改浏览器设置的方式拒绝接受cookies。但如果您选择拒绝接受cookies，则您可能无法登录或使用依赖于cookies的本应用网络服务或功能。\r\n          <br>\r\n          (c) 通过本应用所设cookies所取得的有关信息，将适用本政策。 \r\n       </view>\r\n       <view>\r\n           \r\n         6.信息安全<br>\r\n         (a) 本应用帐号均有安全保护功能，请妥善保管您的用户名及密码信息。本应用将通过对用户密码进行加密等安全措施确保您的信息不丢失，不被滥用和变造。尽管有前述安全措施，但同时也请您注意在信息网络上不存在“完善的安全措施”。\r\n         <br>\r\n         (b) 在使用本应用网络服务进行网上交易时，您不可避免的要向交易对方或潜在的交易对  \r\n       </view>\r\n       <view>\r\n          7.本隐私政策的更改<br>\r\n          \r\n          (a)如果决定更改隐私政策，我们会在本政策中、本公司网站中以及我们认为适当的位置发布这些更改，以便您了解我们如何收集、使用您的个人信息，哪些人可以访问这些信息，以及在什么情况下我们会透露这些信息。\r\n          <br>\r\n          (b)本公司保留随时修改本政策的权利，因此请经常查看。如对本政策作出重大更改，本公司会通过通知的形式告知。\r\n          <br>\r\n          方披露自己的个人信息，如联络方式或者邮政地址。请您妥善保护自己的个人信息，仅在必要的情形下向他人提供。如您发现自己的个人信息泄密，尤其是本应用用户名及密码发生泄露，请您立即联络本应用客服，以便本应用采取相应措施。\r\n           \r\n           \r\n       </view>\r\n <view>\r\n          8.联系我们<br>\r\n          \r\n          如果您对个人信息保护问题有投诉、建议、疑问，请联系我们官方小助手。\r\n           \r\n       </view>', '一小时日赚600-800！赶快联系我，快速带您日赚3000-5000元', '第三方监督机制，为保障每位会员的合法权益，公平、公正、公开的进行监督与监管工作！', 1616072133, 1616758566);
